import React from 'react';
import './Modal.css';


class Modal extends React.Component {

    render() {
        const visibility = this.props.modalVisibility;
        return (
            <div className={`modal ${visibility}`}>
                <img src={this.props.ModalPic} alt=""/>
                this.props.ModalPic
            </div>
        )
    }
}

export default Modal;
